import React from "react";
import { Card, Image, Heading } from "rebass";

const BadgeItem = ({ badge, idx }) => {
  console.log("badge", badge, idx);

  return (
    <Card width={256}>
      <Image src={badge.files[idx]} />
      <Heading>Card</Heading>
    </Card>
  );
};

export default BadgeItem;
